import React, { useState } from 'react';
import { TextField, Button, Typography, Box, Table, TableContainer, TableHead, TableRow, TableCell, TableBody, Paper, IconButton } from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';
import RefreshIcon from '@mui/icons-material/Refresh';
import VisibilityIcon from '@mui/icons-material/Visibility';

const ManageMovies = () => {
  const [urlApi, setUrlApi] = useState('');
  const [movies, setMovies] = useState([]);

  const handleUrlInputChange = (event) => {
    setUrlApi(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    const newMovie = {
      movie_id: movies.length + 1,
      movie_api_url: urlApi,
      movie_name: 'Tên phim',
      movie_origin_name: 'Tên gốc phim',
      movie_country: 'Quốc gia',
      movie_category: 'Thể loại'
    };

    setMovies([...movies, newMovie]);
    setUrlApi('');
  };

  const handleDelete = (movie_id) => {
    setMovies(movies.filter(movie => movie.movie_id !== movie_id));
  };

  const handleReload = (movie_id) => {
    // Thực hiện xử lý làm mới dữ liệu phim tại đây
    console.log(`Reload movie with ID: ${movie_id}`);
  };

  const handleView = (movie_id) => {
    // Thực hiện xử lý xem chi tiết phim tại đây
    console.log(`View movie with ID: ${movie_id}`);
  };

  return (
    <Box sx={{ maxWidth: 1000, mx: 'auto', mt: 4, p: 3, bgcolor: 'background.paper', boxShadow: 1, borderRadius: 4 }}>
      <Typography variant="h4" gutterBottom>
        Quản lý phim
      </Typography>
      <Typography variant="body1" gutterBottom>
        Đây là trang quản lý phim.
      </Typography>

      <form onSubmit={handleSubmit} sx={{ width: '100%', display: 'flex', alignItems: 'center', justifyContent: 'space-between' }}>
        <TextField
          label="URL API phim"
          fullWidth
          value={urlApi}
          onChange={handleUrlInputChange}
          variant="outlined"
          margin="normal"
          placeholder="Nhập URL API phim..."
          sx={{ flex: '1 1 auto', mr: 2 }}
        />
        <Button
          type="submit"
          variant="contained"
          color="primary"
          disableElevation
          sx={{ flex: '0 0 auto' }}
        >
          Thêm phim
        </Button>
      </form>

      <Box sx={{ mt: 3 }}>
        <TableContainer component={Paper}>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Movie ID</TableCell>
                <TableCell>Movie API URL</TableCell>
                <TableCell>Movie Name</TableCell>
                <TableCell>Movie Origin Name</TableCell>
                <TableCell>Movie Country</TableCell>
                <TableCell>Movie Category</TableCell>
                <TableCell>Actions</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {movies.map((movie) => (
                <TableRow key={movie.movie_id}>
                  <TableCell>{movie.movie_id}</TableCell>
                  <TableCell>{movie.movie_api_url}</TableCell>
                  <TableCell>{movie.movie_name}</TableCell>
                  <TableCell>{movie.movie_origin_name}</TableCell>
                  <TableCell>{movie.movie_country}</TableCell>
                  <TableCell>{movie.movie_category}</TableCell>
                  <TableCell>
                    <IconButton onClick={() => handleView(movie.movie_id)} color="primary">
                      <VisibilityIcon />
                    </IconButton>
                    <IconButton onClick={() => handleReload(movie.movie_id)} color="secondary">
                      <RefreshIcon />
                    </IconButton>
                    <IconButton onClick={() => handleDelete(movie.movie_id)} color="error">
                      <DeleteIcon />
                    </IconButton>
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      </Box>
    </Box>
  );
};

export default ManageMovies;
